import React, { useState, useEffect, useRef, useMemo, useCallback } from 'react';
import { Calendar, Users, MapPin, BarChart3, Clock, Shield, Zap, DollarSign, TrendingUp, Activity, X, MessageSquare, Wrench, Code, Settings, Loader, RefreshCw, Upload, Play, Pause, RotateCcw, Eye, Brain, Heart, Compass, Mic, Globe, Search, Target, BookOpen, Cog } from 'lucide-react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, AreaChart, Area, BarChart, Bar, RadialBarChart, RadialBar, PieChart, Pie, Cell } from 'recharts';

const SentariOS = () => {
  // Core State Management
  const [activeModule, setActiveModule] = useState('dashboard');
  const [businessData, setBusinessData] = useState({
    companyName: 'Markham Investigation & Protection',
    industry: 'security',
    totalEmployees: 47,
    monthlyRevenue: 125000,
    totalClients: 12,
    activeSites: 23
  });

  // 12-Core AI System State
  const [aiCores, setAiCores] = useState({});
  const [coreActivities, setCoreActivities] = useState([]);
  const [interCoreComms, setInterCoreComms] = useState([]);
  const [aetherisMode, setAetherisMode] = useState('assistant'); // assistant, analytics, coordination

  // AI Builder State
  const [isBuilding, setIsBuilding] = useState(false);
  const [buildProgress, setBuildProgress] = useState(0);
  const [generatedModules, setGeneratedModules] = useState([]);
  const [buildLogs, setBuildLogs] = useState([]);

  // Enhanced Chat State for Aetheris
  const [messages, setMessages] = useState([
    { 
      role: 'aetheris', 
      content: `🧠 **Aetheris AI Business Partner Initialized**

**12-Core Intelligence Network Status:** ✅ **ONLINE**

I'm Aetheris, your central AI business partner. I coordinate 12 specialized AI cores that watch, learn, and optimize every aspect of your business:

🔮 **Oracle Core** - Strategic forecasting and market intelligence
📊 **Pulse Core** - Real-time KPI monitoring and alerts  
🕵️ **Echo Core** - Pattern recognition and anomaly detection
👨‍🏫 **Mentor Core** - Performance coaching and development
🎭 **Relay Core** - Workflow automation and orchestration
🗺️ **Atlas Core** - Operational optimization and deployment
📝 **Lexicon Core** - Communication and proposal generation
🤝 **Harmony Core** - Client success and retention
❤️ **Empath Core** - Employee sentiment and behavior analysis
🛡️ **Persona Core** - Executive protection intelligence
📚 **Scholar Core** - Knowledge management and learning
⚡ **Forge Core** - AI innovation and customization

**What would you like me to help you with today?**`, 
      timestamp: new Date(),
      coreSource: 'aetheris'
    }
  ]);
  const [inputMessage, setInputMessage] = useState('');
  const [aiChatOpen, setAiChatOpen] = useState(false);
  const [isProcessing, setIsProcessing] = useState(false);

  // File Upload State
  const [uploadedFiles, setUploadedFiles] = useState([]);
  const [isDragging, setIsDragging] = useState(false);

  // Module Management
  const [deleteConfirmation, setDeleteConfirmation] = useState(null);

  // Connection and External Data State
  const [isConnected, setIsConnected] = useState(false);
  const [backendStatus, setBackendStatus] = useState('checking');
  const [externalData, setExternalData] = useState({
    weather: null,
    traffic: null,
    news: [],
    marketData: null
  });

  // Refs
  const chatMessagesRef = useRef(null);
  const fileInputRef = useRef(null);

  // 12-Core AI System Definitions
  const aiCoreDefinitions = useMemo(() => ({
    oracle: {
      name: 'Oracle Core',
      personality: 'Strategic Foresight Engine',
      icon: Eye,
      color: 'purple',
      description: 'Long-range forecasting and strategic analysis',
      capabilities: ['market-prediction', 'churn-forecasting', 'growth-opportunities', 'scenario-modeling'],
      status: 'active',
      confidence: 94,
      lastActivity: 'Analyzing Q4 market trends for security industry'
    },
    pulse: {
      name: 'Pulse Core',
      personality: 'Real-Time Monitor',
      icon: Activity,
      color: 'red',
      description: 'Live KPI monitoring and performance tracking',
      capabilities: ['real-time-alerts', 'threshold-monitoring', 'performance-tracking', 'dashboard-updates'],
      status: 'active',
      confidence: 98,
      lastActivity: 'Monitoring 23 active sites in real-time'
    },
    echo: {
      name: 'Echo Core',
      personality: 'Pattern Detective',
      icon: Search,
      color: 'blue',
      description: 'Anomaly detection and pattern recognition',
      capabilities: ['pattern-analysis', 'anomaly-detection', 'risk-assessment', 'correlation-mapping'],
      status: 'active',
      confidence: 89,
      lastActivity: 'Detected unusual incident pattern at retail locations'
    },
    mentor: {
      name: 'Mentor Core',
      personality: 'Performance Coach',
      icon: Target,
      color: 'green',
      description: 'Employee development and coaching intelligence',
      capabilities: ['performance-prediction', 'training-recommendations', 'coaching-moments', 'career-pathing'],
      status: 'active',
      confidence: 92,
      lastActivity: 'Identified 3 guards ready for advancement'
    },
    relay: {
      name: 'Relay Core',
      personality: 'Master Orchestrator',
      icon: Cog,
      color: 'orange',
      description: 'Workflow automation and system coordination',
      capabilities: ['workflow-automation', 'system-integration', 'task-orchestration', 'exception-handling'],
      status: 'active',
      confidence: 96,
      lastActivity: 'Automated payroll processing for 47 employees'
    },
    atlas: {
      name: 'Atlas Core',
      personality: 'Operations Commander',
      icon: Compass,
      color: 'indigo',
      description: 'Operational optimization and resource management',
      capabilities: ['resource-optimization', 'deployment-planning', 'cost-efficiency', 'route-optimization'],
      status: 'active',
      confidence: 91,
      lastActivity: 'Optimized guard deployment saving $2,400/week'
    },
    lexicon: {
      name: 'Lexicon Core',
      personality: 'Master Communicator',
      icon: MessageSquare,
      color: 'cyan',
      description: 'Communication and document generation',
      capabilities: ['proposal-generation', 'report-creation', 'communication-optimization', 'document-intelligence'],
      status: 'active',
      confidence: 87,
      lastActivity: 'Generated winning proposal for new hospital contract'
    },
    harmony: {
      name: 'Harmony Core',
      personality: 'Relationship Guardian',
      icon: Heart,
      color: 'pink',
      description: 'Client success and relationship optimization',
      capabilities: ['churn-prediction', 'satisfaction-monitoring', 'upsell-identification', 'relationship-health'],
      status: 'active',
      confidence: 93,
      lastActivity: 'Prevented McDonald\'s contract churn (85% risk)'
    },
    empath: {
      name: 'Empath Core',
      personality: 'Behavioral Psychologist',
      icon: Brain,
      color: 'teal',
      description: 'Employee sentiment and behavioral analysis',
      capabilities: ['sentiment-analysis', 'behavioral-patterns', 'engagement-monitoring', 'turnover-prediction'],
      status: 'active',
      confidence: 88,
      lastActivity: 'Flagged potential burnout in 2 senior guards'
    },
    persona: {
      name: 'Persona Core',
      personality: 'Security Strategist',
      icon: Shield,
      color: 'gray',
      description: 'Executive protection and threat intelligence',
      capabilities: ['threat-assessment', 'protection-planning', 'security-intelligence', 'risk-mitigation'],
      status: 'active',
      confidence: 95,
      lastActivity: 'Updated threat assessment for executive travel'
    },
    scholar: {
      name: 'Scholar Core',
      personality: 'Master Librarian',
      icon: BookOpen,
      color: 'amber',
      description: 'Knowledge management and learning coordination',
      capabilities: ['knowledge-curation', 'training-design', 'compliance-tracking', 'learning-optimization'],
      status: 'active',
      confidence: 90,
      lastActivity: 'Updated SOPs for new security protocols'
    },
    forge: {
      name: 'Forge Core',
      personality: 'Innovation Lab',
      icon: Wrench,
      color: 'emerald',
      description: 'AI development and platform evolution',
      capabilities: ['ai-development', 'platform-enhancement', 'custom-solutions', 'innovation-research'],
      status: 'active',
      confidence: 86,
      lastActivity: 'Developing industry-specific AI adaptations'
    }
  }), []);

  // Initialize 12-Core AI System
  useEffect(() => {
    const initializeAICores = () => {
      setAiCores(aiCoreDefinitions);
      
      // Simulate initial AI core activities
      setCoreActivities([
        { time: new Date(Date.now() - 300000), core: 'pulse', action: 'Real-time monitoring activated for all 23 sites', type: 'monitoring' },
        { time: new Date(Date.now() - 600000), core: 'oracle', action: 'Q4 revenue forecast updated: $1.2M projected', type: 'prediction' },
        { time: new Date(Date.now() - 900000), core: 'echo', action: 'Pattern detected: 15% increase in weekend incidents', type: 'analysis' },
        { time: new Date(Date.now() - 1200000), core: 'harmony', action: 'Client satisfaction score calculated: 4.2/5.0', type: 'relationship' }
      ]);

      setBuildLogs(prev => [...prev, { 
        time: new Date(), 
        message: '🧠 12-Core AI Intelligence Network initialized successfully', 
        type: 'success' 
      }]);
    };

    initializeAICores();
  }, [aiCoreDefinitions]);

  // Mock External Data Integration
  useEffect(() => {
    const fetchExternalData = async () => {
      // Simulate fetching real-world data that Aetheris would have access to
      setExternalData({
        weather: {
          location: 'Seattle, WA',
          current: '42°F, Rainy',
          forecast: 'Heavy rain expected 6-8 PM',
          impact: 'Consider additional coverage for outdoor sites'
        },
        traffic: {
          condition: 'Heavy traffic on I-5 North',
          impact: 'Potential delays for evening shift changes',
          recommendation: 'Alert guards to leave 15 minutes early'
        },
        news: [
          { headline: 'Seattle retail theft incidents up 23% this month', relevance: 'High - affects retail client security' },
          { headline: 'New WA state security guard licensing requirements', relevance: 'Critical - compliance update needed' }
        ],
        marketData: {
          securityIndustryGrowth: '+8.2%',
          averageGuardWage: '$18.50/hr',
          competitorAnalysis: '3 new security companies in service area'
        }
      });
    };

    fetchExternalData();
    const interval = setInterval(fetchExternalData, 300000); // Update every 5 minutes
    return () => clearInterval(interval);
  }, []);

  // Enhanced Dashboard Data with 12-Core Insights
  const enhancedDashboardData = useMemo(() => ({
    executiveKPIs: [
      { 
        title: 'Revenue Trajectory', 
        value: '$125,000', 
        change: '+12%', 
        positive: true,
        source: 'Oracle Core Prediction',
        insight: 'Q4 projected at $1.2M based on contract renewals'
      },
      { 
        title: 'Client Health Score', 
        value: '4.2/5.0', 
        change: '+0.3', 
        positive: true,
        source: 'Harmony Core Analysis',
        insight: 'McDonald\'s satisfaction improved after protocol changes'
      },
      { 
        title: 'Guard Performance', 
        value: '94%', 
        change: '+2%', 
        positive: true,
        source: 'Mentor Core Assessment',
        insight: '3 guards identified for promotion opportunities'
      },
      { 
        title: 'Operational Efficiency', 
        value: '89%', 
        change: '-1%', 
        positive: false,
        source: 'Atlas Core Optimization',
        insight: 'Weather delays affecting shift changes'
      }
    ],
    coreInsights: [
      { core: 'echo', type: 'warning', message: 'Unusual incident pattern detected at retail locations - recommend security briefing', confidence: 89 },
      { core: 'oracle', type: 'opportunity', message: 'Market analysis suggests 23% growth potential in healthcare security', confidence: 76 },
      { core: 'empath', type: 'concern', message: '2 senior guards showing burnout indicators - intervention recommended', confidence: 82 },
      { core: 'pulse', type: 'alert', message: 'McDonald\'s site KPIs exceeded targets for 7 consecutive days', confidence: 98 }
    ],
    revenue: [
      { month: 'Jul', value: 98000, forecast: 102000, oracle: 99500 },
      { month: 'Aug', value: 115000, forecast: 118000, oracle: 116200 },
      { month: 'Sep', value: 125000, forecast: 122000, oracle: 124800 },
      { month: 'Oct', value: null, forecast: 135000, oracle: 138200 },
      { month: 'Nov', value: null, forecast: 142000, oracle: 145600 },
      { month: 'Dec', value: null, forecast: 155000, oracle: 158900 }
    ],
    aiCollaboration: [
      { time: new Date(Date.now() - 120000), from: 'echo', to: 'mentor', message: 'Guard fatigue pattern detected', action: 'Training intervention scheduled' },
      { time: new Date(Date.now() - 300000), from: 'harmony', to: 'atlas', message: 'Client satisfaction drop at Site C', action: 'Guard reassignment recommended' },
      { time: new Date(Date.now() - 600000), from: 'oracle', to: 'lexicon', message: 'Hospital contract opportunity identified', action: 'Proposal generation initiated' }
    ]
  }), []);

  // Enhanced AI Chat with Aetheris Intelligence
  const handleAetherisChat = useCallback(async (message) => {
    setIsProcessing(true);
    
    try {
      // Analyze which AI cores should respond
      const relevantCores = analyzeMessageForCores(message);
      
      setBuildLogs(prev => [...prev, { 
        time: new Date(), 
        message: `Aetheris coordinating with: ${relevantCores.join(', ')}`, 
        type: 'coordination' 
      }]);

      // Simulate AI core consultation
      let response = '';
      
      if (message.toLowerCase().includes('forecast') || message.toLowerCase().includes('predict')) {
        response = await oracleCoreResponse(message);
      } else if (message.toLowerCase().includes('performance') || message.toLowerCase().includes('employee')) {
        response = await mentorCoreResponse(message);
      } else if (message.toLowerCase().includes('client') || message.toLowerCase().includes('satisfaction')) {
        response = await harmonyCoreResponse(message);
      } else if (message.toLowerCase().includes('pattern') || message.toLowerCase().includes('analyze')) {
        response = await echoCoreResponse(message);
      } else if (message.toLowerCase().includes('build') || message.toLowerCase().includes('create')) {
        response = await forgeCoreResponse(message);
      } else {
        response = await aetherisGeneralResponse(message);
      }

      // Add inter-core communication
      const coreComm = {
        time: new Date(),
        cores: relevantCores,
        query: message,
        result: 'Collaborative analysis complete'
      };
      setInterCoreComms(prev => [coreComm, ...prev.slice(0, 9)]);

      const aiMessage = {
        role: 'aetheris',
        content: response,
        timestamp: new Date(),
        coreSource: relevantCores[0] || 'aetheris',
        collaboratingCores: relevantCores
      };
      
      setMessages(prev => [...prev, 
        { role: 'user', content: message, timestamp: new Date() }, 
        aiMessage
      ]);
      
    } catch (error) {
      setBuildLogs(prev => [...prev, { 
        time: new Date(), 
        message: `Aetheris error: ${error.message}`, 
        type: 'error' 
      }]);
      
      setMessages(prev => [...prev, 
        { role: 'user', content: message, timestamp: new Date() },
        { 
          role: 'aetheris', 
          content: `🚨 **System Error Detected**\n\nI encountered an issue while coordinating with the AI cores: ${error.message}\n\nSwitching to backup analysis mode. How can I help you with a different approach?`, 
          timestamp: new Date(),
          coreSource: 'aetheris'
        }
      ]);
    } finally {
      setIsProcessing(false);
    }
  }, []);

  // AI Core Response Functions
  const analyzeMessageForCores = (message) => {
    const msg = message.toLowerCase();
    const cores = [];
    
    if (msg.includes('forecast') || msg.includes('predict') || msg.includes('future')) cores.push('oracle');
    if (msg.includes('performance') || msg.includes('kpi') || msg.includes('metric')) cores.push('pulse');
    if (msg.includes('pattern') || msg.includes('analyze') || msg.includes('detect')) cores.push('echo');
    if (msg.includes('employee') || msg.includes('guard') || msg.includes('training')) cores.push('mentor');
    if (msg.includes('automate') || msg.includes('workflow') || msg.includes('process')) cores.push('relay');
    if (msg.includes('optimize') || msg.includes('efficient') || msg.includes('deployment')) cores.push('atlas');
    if (msg.includes('proposal') || msg.includes('communication') || msg.includes('report')) cores.push('lexicon');
    if (msg.includes('client') || msg.includes('customer') || msg.includes('satisfaction')) cores.push('harmony');
    if (msg.includes('sentiment') || msg.includes('morale') || msg.includes('behavior')) cores.push('empath');
    if (msg.includes('security') || msg.includes('threat') || msg.includes('protection')) cores.push('persona');
    if (msg.includes('knowledge') || msg.includes('learning') || msg.includes('training')) cores.push('scholar');
    if (msg.includes('build') || msg.includes('create') || msg.includes('develop')) cores.push('forge');
    
    return cores.length > 0 ? cores : ['aetheris'];
  };

  const oracleCoreResponse = async (message) => {
    await new Promise(resolve => setTimeout(resolve, 2000)); // Simulate deep analysis
    
    return `🔮 **Oracle Core - Strategic Foresight Analysis**

**📊 Based on current business trajectory and market intelligence:**

**Q4 2025 Forecast:**
• Revenue: $1.24M (+18% growth)
• New contracts: 3-4 opportunities (hospital sector showing 23% growth)
• Risk factors: 2 major competitors expanding in Seattle area

**🎯 Strategic Recommendations:**
1. **Immediate (Next 30 days):** Pursue healthcare security contracts - Oracle Core predicts 76% success rate
2. **Short-term (90 days):** Expand guard training program - Mentor Core data shows 94% retention improvement
3. **Long-term (6 months):** Consider acquiring smaller security firm - market consolidation trend identified

**🌍 External Intelligence:**
• **Market Trend:** Security industry growing 8.2% annually
• **Economic Factor:** Corporate security budgets increasing post-pandemic
• **Competitive Landscape:** Window of opportunity before market saturation

**Confidence Level:** 94% | **Collaboration:** Echo, Pulse, Harmony Cores consulted

*Oracle Core recommendation: Focus on healthcare expansion while strengthening current client relationships.*`;
  };

  const mentorCoreResponse = async (message) => {
    await new Promise(resolve => setTimeout(resolve, 1500));
    
    return `👨‍🏫 **Mentor Core - Performance Intelligence Report**

**👥 Employee Development Analysis:**

**🌟 High Performers (Ready for Advancement):**
• **Sarah Johnson** - 96% client satisfaction, 0 incidents, leadership potential
• **Mike Rodriguez** - Excellent problem-solving, 98% punctuality, training others
• **Lisa Chen** - Superior incident documentation, client feedback champion

**⚠️ Performance Concerns:**
• **Guard #47** - 23% increase in minor infractions (Echo Core pattern detected)
• **Night Shift Team** - Empath Core flagged fatigue indicators

**🎯 Training Recommendations:**
1. **Conflict De-escalation** - 12 guards need refresher (Echo Core incident analysis)
2. **Customer Service Excellence** - Harmony Core suggests focus on retail sites
3. **Leadership Development** - 3 candidates ready for supervisor roles

**📈 Performance Predictions:**
• **Team Productivity:** +15% improvement with recommended training
• **Client Satisfaction:** +8% increase with service excellence focus
• **Retention Rate:** 94% projected (up from 89%) with development investment

**Collaboration:** Working with Empath Core on morale monitoring and Atlas Core on optimal assignment strategies.

*Mentor Core recommendation: Invest in leadership development program for identified high performers.*`;
  };

  const harmonyCoreResponse = async (message) => {
    await new Promise(resolve => setTimeout(resolve, 1800));
    
    return `🤝 **Harmony Core - Client Relationship Intelligence**

**💝 Client Health Dashboard:**

**🟢 Excellent Health (8.5-10/10):**
• **Seattle Children's Hospital** - 9.2/10 (contract renewal certain)
• **Westfield Shopping Center** - 8.8/10 (expansion opportunity identified)

**🟡 Monitoring Required (6.0-8.4/10):**
• **McDonald's Downtown** - 7.1/10 (improved from 6.2 after service changes)
• **Office Complex Network** - 7.8/10 (stable but needs attention)

**🔴 Risk Alert (Below 6.0/10):**
• **None currently** - All clients above risk threshold ✅

**🎯 Relationship Optimization:**
• **Upsell Opportunity:** Seattle Children's ready for expanded evening coverage (+$15K/month)
• **Retention Strategy:** McDonald's needs quarterly business review to maintain momentum
• **New Business:** Hospital network showing interest after reference from existing client

**📞 Communication Intelligence:**
• **Response Time:** Average 2.3 hours (industry standard: 4-6 hours)
• **Resolution Rate:** 94% first-contact resolution
• **Satisfaction Trend:** +12% improvement over 90 days

**🔮 Churn Prediction:**
• **Next 30 days:** 0% churn risk (Oracle Core confirms)
• **Next 90 days:** 5% risk from Office Complex (price sensitivity detected)

**Collaboration:** Oracle Core providing market context, Empath Core monitoring client communication sentiment.

*Harmony Core recommendation: Schedule proactive meetings with all 7.5+ scored clients for expansion discussions.*`;
  };

  const echoCoreResponse = async (message) => {
    await new Promise(resolve => setTimeout(resolve, 1600));
    
    return `🕵️ **Echo Core - Pattern Recognition Analysis**

**🔍 Anomaly Detection Results:**

**⚠️ Critical Patterns Identified:**
1. **Weekend Incident Spike** - 23% increase in retail location incidents Friday-Sunday
2. **Shift Change Vulnerability** - 67% of incidents occur within 30 minutes of shift changes
3. **Weather Correlation** - 34% more incidents during rain (Pulse Core weather integration confirms)

**📊 Performance Correlations:**
• **High performers** work 15% fewer overtime hours (efficiency indicator)
• **Client complaints** drop 89% when same guard assigned 3+ consecutive weeks
• **Incident resolution time** correlates with guard experience level (R² = 0.84)

**🎯 Predictive Alerts:**
• **This Weekend:** 78% probability of incident at Westfield (pattern suggests Saturday 2-4 PM)
• **Next Week:** Guard fatigue risk increases (Mentor Core data confirms overtime pattern)
• **Monthly Trend:** Client satisfaction peaks correlate with consistent staffing

**🧠 Cross-Core Intelligence:**
• **Atlas Core Data:** Optimal deployment reduces incidents by 43%
• **Empath Core Input:** Guard stress levels correlate with incident rates
• **Oracle Core Validation:** Pattern predictions accurate 87% of time

**🚨 Immediate Actions Recommended:**
1. **Add extra coverage** Westfield Saturday afternoon (high confidence)
2. **Review shift change protocols** (vulnerability window identified)
3. **Implement weather-based staffing** (proven correlation)

*Echo Core insight: Human behavior patterns are more predictable than expected - leverage this for operational advantage.*`;
  };

  const forgeCoreResponse = async (message) => {
    await new Promise(resolve => setTimeout(resolve, 2200));
    
    return `⚡ **Forge Core - AI Innovation Lab Response**

