              <div className="flex items-center space-x-2 mb-2">
                <Loader className="animate-spin" size={16} />
                <span className="text-sm font-medium">Aetheris coordinating AI cores...</span>
              </div>
              <div className="text-xs text-gray-600">
                {interCoreComms[0]?.cores.length > 0 && `Consulting: ${interCoreComms[0].cores.join(', ')} cores`}
              </div>
            </div>
          )}

          {/* Messages */}
          <div ref={chatMessagesRef} className="flex-1 overflow-y-auto p-4 space-y-4">
            {messages.map((message, index) => (
              <div
                key={index}
                className={`flex ${message.role === 'user' ? 'justify-end' : 'justify-start'}`}
              >
                <div
                  className={`max-w-[85%] ${
                    message.role === 'user'
                      ? 'bg-blue-600 text-white rounded-lg p-3'
                      : 'bg-white border border-gray-200 rounded-lg p-4 shadow-sm'
                  }`}
                >
                  {message.role === 'aetheris' && (
                    <div className="flex items-center space-x-2 mb-2">
                      <Brain size={16} className="text-purple-600" />
                      <span className="text-xs font-medium text-purple-600">
                        {message.coreSource === 'aetheris' ? 'Aetheris' : `${message.coreSource?.charAt(0).toUpperCase() + message.coreSource?.slice(1)} Core`}
                      </span>
                      {message.collaboratingCores && message.collaboratingCores.length > 1 && (
                        <span className="text-xs text-gray-500">
                          + {message.collaboratingCores.length - 1} cores
                        </span>
                      )}
                    </div>
                  )}
                  <div className="text-sm whitespace-pre-wrap">{message.content}</div>
                  <div className={`text-xs mt-2 opacity-70 ${message.role === 'user' ? 'text-blue-100' : 'text-gray-500'}`}>
                    {message.timestamp.toLocaleTimeString()}
                  </div>
                </div>
              </div>
            ))}
            {isProcessing && (
              <div className="flex justify-start">
                <div className="bg-white border border-gray-200 rounded-lg p-4 shadow-sm">
                  <div className="flex items-center space-x-2">
                    <Loader className="animate-spin" size={16} className="text-purple-600" />
                    <span className="text-sm">Aetheris is coordinating AI cores...</span>
                  </div>
                </div>
              </div>
            )}
          </div>

          {/* File Upload Area */}
          <div
            className={`p-4 border-t border-gray-200 ${isDragging ? 'bg-blue-50' : 'bg-gray-50'}`}
            onDragOver={handleDragOver}
            onDragLeave={handleDragLeave}
            onDrop={handleDrop}
          >
            <div className="text-center">
              <Upload size={16} className="mx-auto text-gray-400 mb-2" />
              <p className="text-xs text-gray-600">
                {isDragging ? 'Drop files for AI analysis' : 'Upload files for business intelligence'}
              </p>
              <input
                ref={fileInputRef}
                type="file"
                multiple
                className="hidden"
                onChange={(e) => {
                  const files = Array.from(e.target.files);
                  handleFileUpload(files);
                }}
              />
              <button
                onClick={() => fileInputRef.current?.click()}
                className="text-xs text-blue-600 hover:text-blue-800 mt-1"
              >
                Browse Files
              </button>
            </div>
          </div>

          {/* Enhanced Chat Input */}
          <div className="p-4 border-t border-gray-200">
            <div className="flex space-x-2">
              <textarea
                value={inputMessage}
                onChange={(e) => setInputMessage(e.target.value)}
                onKeyDown={handleChatKeyDown}
                placeholder="Ask Aetheris anything about your business..."
                className="flex-1 px-3 py-2 border border-gray-300 rounded-lg resize-none focus:ring-2 focus:ring-purple-500 focus:border-transparent"
                rows="2"
                disabled={isProcessing}
              />
              <button
                onClick={() => {
                  if (inputMessage.trim()) {
                    handleAetherisChat(inputMessage.trim());
                    setInputMessage('');
                  }
                }}
                disabled={isProcessing || !inputMessage.trim()}
                className="px-4 py-2 bg-gradient-to-r from-blue-600 to-purple-600 text-white rounded-lg hover:from-blue-700 hover:to-purple-700 disabled:opacity-50 transition-all flex items-center justify-center"
              >
                {isProcessing ? <Loader className="animate-spin" size={16} /> : <Brain size={16} />}
              </button>
            </div>
            <p className="text-xs text-gray-500 mt-2">
              Ask about forecasting, patterns, optimization, or anything business-related
            </p>
          </div>
        </div>
      )}

      {/* Delete Confirmation Modal */}
      <DeleteConfirmationDialog />

      {/* File Upload Overlay */}
      {isDragging && (
        <div className="fixed inset-0 bg-blue-600 bg-opacity-20 z-50 flex items-center justify-center">
          <div className="bg-white rounded-xl p-8 shadow-2xl border-2 border-blue-600 border-dashed">
            <Upload size={48} className="mx-auto text-blue-600 mb-4" />
            <p className="text-xl font-semibold text-gray-900 text-center">Drop Files for AI Analysis</p>
            <p className="text-gray-600 text-center">Scholar & Echo cores will analyze for business insights</p>
          </div>
        </div>
      )}

      {/* Quick Actions with AI Core Access */}
      <div className="fixed bottom-6 right-6 z-40">
        <div className="flex flex-col space-y-2">
          {!aiChatOpen && (
            <button
              onClick={() => setAiChatOpen(true)}
              className="w-14 h-14 bg-gradient-to-r from-blue-600 to-purple-600 text-white rounded-full shadow-xl hover:shadow-2xl transition-all flex items-center justify-center group"
              title="Open Aetheris AI Chat (Ctrl+K)"
            >
              <Brain size={24} className="group-hover:scale-110 transition-transform" />
            </button>
          )}
          
          <button
            onClick={() => {
              setAiChatOpen(true);
              setTimeout(() => {
                setInputMessage('Oracle Core, provide a strategic forecast for my business');
              }, 100);
            }}
            className="w-14 h-14 bg-purple-600 text-white rounded-full shadow-xl hover:shadow-2xl transition-all flex items-center justify-center"
            title="Oracle Core Forecast"
          >
            <Eye size={20} />
          </button>
          
          <button
            onClick={() => {
              setAiChatOpen(true);
              setTimeout(() => {
                setInputMessage('Forge Core, build me an intelligent business module');
              }, 100);
            }}
            className="w-14 h-14 bg-emerald-600 text-white rounded-full shadow-xl hover:shadow-2xl transition-all flex items-center justify-center"
            title="Forge Core Builder"
          >
            <Wrench size={20} />
          </button>
        </div>
      </div>

      {/* Enhanced Status Bar */}
      <div className="fixed bottom-0 left-72 right-0 bg-white border-t border-gray-200 px-8 py-3 z-30">
        <div className="flex items-center justify-between text-sm">
          <div className="flex items-center space-x-6">
            <div className={`flex items-center space-x-2 ${isConnected ? 'text-green-600' : 'text-red-600'}`}>
              <div className={`w-2 h-2 rounded-full ${isConnected ? 'bg-green-500' : 'bg-red-500'}`}></div>
              <span>{backendStatus}</span>
            </div>
            <div className="text-gray-500">
              12 AI Cores: {Object.values(aiCoreDefinitions).filter(core => core.status === 'active').length} Active
            </div>
            <div className="text-gray-500">
              {generatedModules.length} AI Modules Generated
            </div>
          </div>
          
          <div className="flex items-center space-x-6 text-gray-500">
            <span>Industry: {businessData.industry?.charAt(0).toUpperCase() + businessData.industry?.slice(1) || 'Not Set'}</span>
            <span>Employees: {businessData.totalEmployees}</span>
            <span>Sites: {businessData.activeSites}</span>
            <span>Revenue: ${businessData.monthlyRevenue?.toLocaleString() || '0'}/mo</span>
          </div>
        </div>
      </div>

      {/* Global Styles */}
      <style>{`
        @keyframes spin {
          0% { transform: rotate(0deg); }
          100% { transform: rotate(360deg); }
        }
        
        .animate-spin {
          animation: spin 1s linear infinite;
        }
        
        /* Custom scrollbar styling */
        .overflow-y-auto::-webkit-scrollbar {
          width: 6px;
        }
        
        .overflow-y-auto::-webkit-scrollbar-track {
          background: #f1f5f9;
        }
        
        .overflow-y-auto::-webkit-scrollbar-thumb {
          background: #cbd5e1;
          border-radius: 3px;
        }
        
        .overflow-y-auto::-webkit-scrollbar-thumb:hover {
          background: #94a3b8;
        }

        /* Enhanced gradient animations */
        .bg-gradient-to-r {
          background-size: 200% 200%;
          animation: gradientShift 3s ease infinite;
        }
        
        @keyframes gradientShift {
          0% { background-position: 0% 50%; }
          50% { background-position: 100% 50%; }
          100% { background-position: 0% 50%; }
        }
      `}</style>
    </div>
  );
};

export default SentariOS;
